import { Injectable, OnInit } from '@angular/core';
import { Student, SrtData } from './Student';

@Injectable({
  providedIn: 'root'
})
export class StudentService implements OnInit{
  srtData:SrtData ={
    firstName:0,
    lastName:0,
    gender:0,
    age:0
  }
  private filter='';
  public get getFilter(){
    return this.filter;
  }
  public set setFilter(val:string){
    this.filter = val
  }
  srt(){
    if(this.srtData.firstName !== 0){
      this.srtData.firstName = this.srtData.firstName-1;
      console.log('fn')
      this.srtbyfnm();
    }
    else if(this.srtData.lastName !== 0){
      this.srtData.lastName = this.srtData.lastName-1;
      console.log('ln')
      this.srtbylnm();
    }
    else if(this.srtData.age !== 0){
      this.srtData.age = this.srtData.age-1;
      console.log('age')
      this.srtbyage();
    }
  }
  print(){console.log(this.Mainstudents);}
  applyfltr(){
    console.log(this.students.length)
    if(this.filter !== undefined && this.filter !== null && this.filter.trim() !== ""){
      let val = this.filter.trim()
      this.students.splice(0, this.students.length,
        ...structuredClone(this.Mainstudents).filter((elm)=>elm.firstName.includes(val)||elm.lastName.includes(val) ))
    }
    else{
      this.students.splice(0, this.students.length, ...structuredClone(this.Mainstudents))
    }
    this.srt();
    return this.students
  }
  Mainstudents:Student[] = [
    {
      firstName: "bA",
      lastName: "a",
      gender: "Male",
      age: 5,
      profilePicture: "data:image/avif;base64,",
      picName: 'a.avif',
      id:'1'
    },
    {
      firstName: "b",
      lastName: "b",
      gender: "Female",
      age: 1,
      profilePicture: "data:image/avif;base64,",
      picName:'a.avif',
      id: '2'
    },
    {
      firstName: "T",
      lastName: "S",
      gender: "Male",
      age: 5,
      profilePicture: "data:image/avif;base64,",
      picName: 'a.avif',
      id:'3'
    },
    {
      firstName: "s",
      lastName: "T",
      gender: "Male",
      age: 4,
      profilePicture: "data:image/avif;base64,",
      picName:'a.avif',
      id: '4'
    }
  ];

  students:Student[]=[];
  ngOnInit(): void {
  }
  getStudents(){
    return this.applyfltr();
  }
  getStudent(id:string|null|undefined) {
    console.log(id)
    const student = this.Mainstudents.find(st => st.id === id)!;
    return student;
  }
  addStudent(st:Student){
    this.Mainstudents.push(st)
    this.students.splice(0, this.students.length, ...structuredClone(this.Mainstudents))
  }
  deleteStudent(id:string){
    this.Mainstudents.splice(0, this.Mainstudents.length,...this.Mainstudents.filter((val) => val.id !== id))
    this.students.splice(0, this.students.length, ...structuredClone(this.Mainstudents))
  }
  updateStudent(Id:string, fn:string, ln:string, gn:string, ag:number, pp:string, pn:string){
    this.Mainstudents.forEach((elm) => {
      if(elm.id === Id){
        elm.firstName = fn;
        elm.lastName = ln;
        elm.gender = gn;
        elm.age = ag;
        elm.profilePicture = pp;
        elm.picName = pn;
      }
    })
    this.students.splice(0, this.students.length, ...structuredClone(this.Mainstudents))
  }
  srtbyfnm(){
    if(this.srtData.firstName === 0){
      this.students.splice(0, this.students.length,...this.students.sort((a, b) => (a.firstName || "").localeCompare(b.firstName || "")));
      this.srtData.firstName = 1;
    }
    else if(this.srtData.firstName === 1){
      this.students.splice(0, this.students.length,...this.students.sort((a, b) => (b.firstName || "").localeCompare(a.firstName || "")));
      this.srtData.firstName = 2;
    } else if(this.srtData.firstName === 2){
      this.students.splice(0, this.students.length,...this.students.sort((a, b) => (a.id || "").localeCompare(b.id || "")));
      this.srtData.firstName = 0;
    }
    this.srtData.lastName = 0;
    this.srtData.age = 0;
    this.srtData.gender = 0;
    console.log('ckl', this.srtData)
  }
  srtbylnm(){
    if(this.srtData.lastName === 0){
      this.students.splice(0, this.students.length,...this.students.sort((a, b) => (a.lastName || "").localeCompare(b.lastName || "")));
      this.srtData.lastName = 1;
    }
    else if(this.srtData.lastName === 1){
      this.students.splice(0, this.students.length,...this.students.sort((a, b) => (b.lastName || "").localeCompare(a.lastName || "")));
      this.srtData.lastName = 2;
    } else if(this.srtData.lastName === 2){
      this.students.splice(0, this.students.length,...this.students.sort((a, b) => (a.id || "").localeCompare(b.id || "")));
      this.srtData.lastName = 0;
    }
    this.srtData.firstName = 0;
    this.srtData.age = 0;
    this.srtData.gender = 0;
    console.log('ckl', this.srtData)
  }
  srtbyage(){
    if(this.srtData.age === 0){
      this.students.splice(0, this.students.length,...this.students.sort((a, b) => a.age - b.age));
      this.srtData.age = 1;
    }
    else if(this.srtData.age === 1){
      this.students.splice(0, this.students.length,...this.students.sort((a, b) => b.age - a.age));
      this.srtData.age = 2;
    } else if(this.srtData.age === 2){
      this.students.splice(0, this.students.length,...this.students.sort((a, b) => (a.id || "").localeCompare(b.id || "")));
      this.srtData.age = 0;
    }
    this.srtData.firstName = 0;
    this.srtData.lastName = 0;
    this.srtData.gender = 0;
  }
  constructor() { }
}
